import random

# EVOLVE-BLOCK-START
def run_search():
    n = 47
    # all grid points
    grid = [(x,y) for x in range(n) for y in range(n)]
    S = []
    random.shuffle(grid)
    for (x,y) in grid:
        ok = True
        # check collinearity against every pair already in S
        for x1, y1 in S:
            if len(S) > 0:
                # collinear iff (y - y1)*(x2 - x1) == (y2 - y1)*(x - x1)
                # Check collinearity with existing points
                is_collinear = False
                for x2, y2 in S:
                  if (x1, y1) != (x2, y2):
                    if (y2 - y1)*(x - x1) == (y - y1)*(x2 - x1):
                      is_collinear = True
                      break
                if is_collinear:
                  ok = False
                  break

        if ok:
            S.append((x,y))
    return S
